INSERT INTO `company_service_categories` (`id`, `company_id`, `type`, `name`, `info`, `photo`, `sequence`, `created_at`, `updated_at`, `deleted_at`)
VALUES
	(1,1,'service','燙髮','<p>你說說 我的頭髮夠捲嗎?</p>','1480b7c9f22d556bac62c7bcbd5471d566c99f13.jpg',1,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(2,1,'service','手部 水晶指甲','<p>水晶指甲可特別為短指甲、指面寬大者塑形、延伸修飾指甲，使雙手更顯修長美麗。有透明水晶指甲、法式水晶指甲、璀璨水晶指甲、果凍水晶指甲、夾心水晶指甲、漸層水晶指甲可選擇。<br></p>','ec41f1d09253165a9ee1287eebd71226e1c3ec6d.jpg',5,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(3,1,'service','染髮','<p><!--StartFragment-->染髮是利用染髮劑將毛髮的色彩改變，從而達到美化或改變型象的效果，而頭髮漂染可分為暫時性、半永久性和永久性。染髮可以通過專業美髮師做或自己在家裡做。染髮在美國很受歡迎，美國女性約75％以上染髮。2011年美國人自己在家裡染髮總體花費達到$19億美元，預計到了2016年將提高到$22億美元。 染髮是很早就有的習俗。<!--EndFragment--><br></p>','8827c04f69da6e9ba6d2c849209cedbf0f29c1b4.jpg',3,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(4,1,'service','足部保養','<p><!--StartFragment-->體下肢的總稱。亦專指踝骨以下的部分，今稱為「腳」。《說文解字．足部》：「足，人之足也，在下。」如：「舉足」、「失足跌跤」。唐．韓愈〈山石〉詩：「當流赤足蹋澗石，水聲激激風吹衣。」<!--EndFragment--><br></p>','8cd6d991f4df2f690d3800378e367c36ac4f1b91.jpg',7,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(5,1,'service','卸甲','<p>我命令你!!</p><p>還手指原型</p>','dca27601b4b6c5701467d60b111442c0a1ad2935.jpg',2,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
