	(58,39,'service','生活美容','做臉就是定期保養皮膚，維持皮膚機能的方式之一，定期做臉且挑對店家選對適合自己的課程，真的是可以維持皮膚機能的，當然這跟保養車子一樣道理，皮膚總有一天還是會老，做臉只是延遲它老的速度，拉長它美麗的時限。','6d8ffe90bf5d1a793626fe619abd49b72105fac6.jpg',2,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
