	(62,39,'service','手部美甲','何為凝膠指甲？\r\n凝膠指甲使用樹脂凝膠利用光照方式將美甲固定，不含毒性化學成分，較不傷真指甲，操作時間大約1～2個小時可以完成！\r\n凝膠指甲也較為輕盈，彈性也較佳，透氣度也較高，維持較容易，做簡單的家事也沒有影響一般來說凝膠美甲都可以維持3-4週。','3afdbe4f68f8389ed1d279f63b44041cbd3a07bf.jpg',6,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
