	(1,1,1,'service','爆炸頭','C4炸藥（英語：C-4, Composition C-4）是塑性炸藥的一種。屬於「C」系列炸藥（有C1-6各種配方），成分不定，常出現在電影電視中。它的爆炸當量為1.34。當密度為1.59g/cm3時，C4爆速可達8040m/s。在攝氏77度貯存時不滲油，在-54至77攝氏度時保持可塑性。\r\nC4炸藥由爆炸物、塑性黏著劑、可塑劑以及標籤劑（taggant）如2,3-二甲基-2,3-二硝基丁烷（DMDNB）組成。其中爆炸物為RDX（旋風炸藥），大約占總重的91%。可塑劑通常為己二酸二辛酯或癸二酸二辛酯（5.3%），粘合劑為聚異丁烯。\r\nC4炸藥的穩定性非常高，只能結合引爆劑以電雷管引爆。即使受到槍擊也不會被引爆，被放到火中也只會慢慢地燃燒。越南戰爭時，士兵在巡邏期間曾通過點燃C4炸藥來給自己取暖。','e18fff53d0192ab510c094332698e55bf97aea8e.jpg',5000,1000,1,NULL,1,15,0,0,'published',0,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
