	(88,13,29,'service','胜肽超聲波導入','Q：超音波保濕導入的原理是什麼呢? \r\nA：超音波導入儀就是透過每秒鐘一百萬次的高速震動，達到對肌膚即身體產生按摩作用，並透過導入的探頭接觸皮膚，藉著高速震盪的原理，溫熱表面肌膚、並把保養成分震碎成更微小的分子，將這些小分子的保養精華帶到肌膚深層，使肌膚能夠徹底吸收保養品，提高保養功效。','2d297c2ccc192fdcb832ce93dba866f576aa4147.jpg',1500,1500,4,'升級「急救安瓶」可另加價',1,120,0,0,'published',3,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(89,13,29,'service','極地海洋活膚術','100%極地天然海藻《針狀顆粒》在搭配EGF精華，有效起到肌膚除舊更新的效果；一次的海綿藻針護理有效改善①滿面油光②毛孔粗大③肌膚蠟黃④肌膚粗糙⑤粉刺痘痘。','cb18c2b2e8a4c192d41e0e924922d3942727eb77.jpg',1999,1999,2,NULL,1,120,0,0,'published',5,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(90,13,29,'service','999黃金極潤抗老','埃及豔后美麗傳說的秘密是....?\r\n當代科學研究證實，黃金具有安定性，有很強的抗氧化能力。另外純金會釋放出負離子，可以優化肌膚的新陳代謝。原來就是「黃金」造就了埃及豔后有著萬年不衰的盛名，不用再羨慕埃及豔后了! 黃金面膜霜有獨特的轉化技術，釋放大量保濕因子，輕鬆促進肌膚光亮與彈性。黃金軟膜擁有獨家日本研磨技術創造超微細奈米黃金粉質，高度負離子且100%親膚，挑戰白、透、亮的黃金V臉。','71e48ac11bd9e4d0bdf2fa3510354066c733c76a.jpg',2500,2500,2,NULL,1,120,0,0,'published',6,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(91,13,29,'service','O2純氧養膚術','高氧保濕課程裡的純氧可進行殺菌行為，可促進傷口癒合，改善組織缺氧增強白血球殺菌能力，抑制挫瘡桿菌；幫助退紅消腫。','e7434d1334c125d1aa447d9b81546dbdaf8f179c.jpg',1500,1500,2,NULL,1,120,0,0,'published',2,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(92,13,29,'service','韓國 AK-LINE液態皮秒','非侵入｜非酸類｜不影響日常生活\r\n（韓國明星 名媛貴婦指定No.1）\r\nAK-LINE液態皮秒循環精華是能讓受損肌膚自然轉變健康的機制，能開啟肌膚通道，深入肌底由內而外改善肌膚問題。\r\n①緊緻毛孔 ②保水澎潤 ③提拉消水腫\r\n④淡斑透亮白 ⑤強化肌膚屏障','ca94bb5d2a0df8eade8a5c709f7ebd6bd3139f13.jpg',5000,5000,2,NULL,1,120,0,0,'published',8,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(93,13,29,'service','專業無痛清粉刺','成年人皮膚代謝週期為21-28天， 代謝差時肌膚新陳代謝的能量不足，使得老化細胞與角質堆積，皮膚看起來暗沉無光，也失去柔嫩與光滑。定期清潔剝離的老廢角質清除擾人的粉刺做個大掃除。','c50043b91d689bfc62e4327e4330af9313cd454d.jpg',800,800,2,NULL,1,120,0,0,'published',1,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(94,13,29,'service','草本複方調理','草本複方酸；可使老廢角質剝離，更新角質層，同時促進膠原纖維生成可改善各類膿包痘痘、黑頭，白頭粉刺、臉部出油的問題。','6d0b90e11165e50c23b1ecdaaa771189a3cad700.jpg',1500,1500,2,NULL,1,120,0,0,'published',4,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(95,13,29,'service','再生微晶育膚術','奈米微晶療法是由細小的穿刺 角質層皮膚，以創造皮膚損傷，刺激肌膚產生新的膠原蛋白和彈性蛋白；膠原蛋白可以通過填充細紋來使皮膚恢復活力，從而全面改善皮膚的質地和緊緻度。①修復肌膚②改善粗糙③補水潤膚','f88e5c39b727859c481bd0df17c6470ae243b20b.jpg',3500,3500,2,NULL,1,120,0,0,'published',7,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(96,13,30,'service','嫁接睫毛','依個人喜好提供個人化設計\r\n價格由800｜1200｜1500價格不同\r\n差別於毛種與濃密度之差異?\r\n他店卸除+300','ddb8e5b26c6ab7cb4b3126159ae97bc4cab9d328.jpg',800,800,3,'800',1,120,0,0,'published',NULL,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(97,13,30,'service','毛流矯正術','做角蛋白到底有什麼好處？？\r\n✔早上不用再花時間夾睫毛\r\n✔效果可維持6-8周\r\n✔可以正常洗卸型也不會不見\r\n✔無異物感不傷睫毛本身\r\n✔捲翹強健睫毛\r\n✔增大眼睛視覺效果\r\n✔可以游泳運動spa流汗\r\n✔可以揉眼睛！！！（這點就夠讚吧）','3e31b4cbc527e729c126d65eefd8ac1da9b54680.jpg',1500,1500,4,'睫毛｜眉毛 （擇一）',1,60,0,0,'published',NULL,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(98,13,31,'service','抽脂術後按摩','抽脂術後的按摩療程建議每週2次且至少持續8週；豐胸術後的按摩療程必需於手術後第5至7天開始，避免組織纖維化。','627d11ad4898fa4cb9f9140e7dccea25bd8216a8.jpg',800,800,4,'10堂包卡另有優惠',1,40,0,0,'published',2,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(99,13,31,'service','術後胸部按摩','✽為避免莢膜發生，黃金期；以少量多次的方式進行，每天至少按摩一小時；六個月至一年須持續配合按摩護理維持理想效果。\r\n✽按摩的原理利用外力將圓盤推動， 讓其接觸手術剝離空間的外圍，以確保剝離的空間不會產生沾黏，保護及維持胸部的鬆軟。','71fd39bf1760c8e999f788dc259f0daa7dd9ee73.jpg',800,800,4,'10堂包卡另有優惠',1,40,0,0,'published',3,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(100,13,31,'service','全身舒壓精油按摩','全身按摩針對身體上不同經、脈、絡的穴位，使用按、 摩、推、拿、捏、揉等六大手技療法，來舒緩肌肉、關節、血管、神經及淋巴等處，讓人體血液循環更好，促進新陳代謝，順利處理體內廢物。','e58d2c61d6172fe2133a055a742a7014238e3f50.jpg',800,800,2,NULL,1,60,0,0,'published',5,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(101,13,31,'service','美胸淋巴保養按摩','按摩可以促進血液循環以及淋巴循環,刺激卵巢分泌雌激素,使胸部皮膚更加有彈性,讓乳房長大達到豐滿目的，有效改善胸部外擴現象。','1068026d3e44809d706b1f9168f2bea627ee43d4.jpg',1999,1999,4,'美胸精油可另外購買',1,120,0,0,'published',6,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(102,13,31,'service','暖宮課程','暖宮是專為女性研製課程，利用熱敷理療以達到為女性暖宮的效用。 溫熱理療對於促進血液循環，溫經止痛，調和氣血，養護卵巢，有一定的功效。（建議1次/月）','e85dc66ef35fadea337391342b17723a9185c696.jpg',1999,1999,2,NULL,1,120,0,0,'published',7,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(103,13,31,'service','局部曲線體雕','利用儀器作用讓身體的皮下組織，提高血液循，刺激肌肉纖維而使肌肉產生收縮，鬆弛緊張的肌肉纖維，減輕肌肉的疼痛，令已經產生的脂肪堆積更能夠經由全身的循環與淋巴系統，而被身體所消耗。','04a7516af137ab7e50286b7570f1e676abdb5a7e.jpg',800,800,2,NULL,1,60,0,0,'published',4,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(104,13,31,'service','飄飄鬆頸耳燭','舒緩精神壓力、排除耳內沉積物及體內的毒素，霉菌等。 這些毒素會變成幼小霧狀，被耳燭吸出﹔清除耳內細菌，清除頭部內的污垢，可使頭腦清新，舒緩頭痛，舒解壓力，對鼻竇炎及鼻過敏、失眠、暈眩等症狀效果特別突顯，讓您有不可言喻的輕鬆舒服感受﹔長期使用，也可達鬆馳淋巴結腫的效果。','7e25b90053d24595269b0829d1acf0da46c9903b.jpg',800,800,2,NULL,1,60,0,0,'published',1,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
