	(205,39,60,'service','補睫','全新接的睫毛建議3週即可進行整理，使睫毛更完整，可再維持約2~3週，非常划算.&nbsp;補接睫毛前由於已有部分嫁接，無法使用全新嫁接時的三步驟徹底清潔，所以殘留的油脂及灰塵較多，維持的時間會比全新嫁接的睫毛短.補接過的睫毛眼型與全新嫁接的睫毛在整齊度上會有些微的落差.補睫勿超過1次，宜卸除徹底清潔後接上新的睫毛，較能永續維持毛髮及眼周皮膚健康.','842218a155c3ad995005854844fd31664379d33f.jpg',999,1,4,'依施作情況計價',1,90,0,0,'published',10,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
