	(4,4,1,NULL,'阿修修',NULL,2,NULL,'0912345678',NULL,NULL,NULL,'9f94805334917044a1cd5e73343938c86fa4db7a.jpg','人的夢想是不會結束的！','#2cadb5','1//0emXHVwa8178kCgYIARAAGA4SNwF-L9IrdLd8QYUUxGos6ZwKVbM8HYvFfdzPypGN0sw6kGvrFHnzpY2tThVTyKJ0ZE7FOv5DZbI','2021-07-07 16:49:17','2021-07-07 16:49:17',NULL),
	(5,NULL,1,NULL,'Nina',NULL,3,NULL,'0963305188',NULL,NULL,NULL,'31dc0bf8d627ae929d95e62d4e9325b7b4544747.jpg','我只是要說，我這個人別無奢求，只希望能夠『心情很平靜』地活下去。『勝負』、『輸贏』，是我最不喜歡和人計較的。因為，那只會為自己弄來『麻煩』和『敵人』……我就是這麼知足的人，這也是我的人生觀。若一定要動手的話，我是不會輸給任何人的。也就是說，如果出現了妨礙我睡眠的『麻煩』和『敵人』，在對方開口前……就會碰到這個！','#293e4d','','2021-07-07 16:49:18','2021-07-07 16:49:18',NULL),
	(6,NULL,1,NULL,'seller',NULL,4,NULL,'0971678860',NULL,NULL,NULL,'28bf01abc89a90994e45f6744f1f863ea4ee45fb.jpg','貝西，你要有所成長，如果不成長的話，我們就抓不住榮光。','#14336b','1//0eMeT_N5jJodVCgYIARAAGA4SNwF-L9IrXYYUwuOWnf-y_uMeMgfjC8FYdQ4j8Y5Ohj7EE0dfaYT-sL4Q9Z6aP1Q5bH0EICbj26I','2021-07-07 16:49:18','2021-07-07 16:49:18',NULL),
	(7,NULL,1,NULL,'Julie',NULL,4,NULL,NULL,NULL,NULL,NULL,'8e8b30c07895869b79e459faf411a765783b01a6.jpg','我的名字叫吉良吉影，33歲。住在杜王町東北部的別墅區一帶，未婚。我在龜友連鎖店服務。每天都要加班到晚上8點才能回家。我不抽煙，酒僅止於淺嚐。晚上11點睡，每天要睡足8個小時。睡前，我一定喝一杯溫牛奶，然後做20分鐘的柔軟操，上了床，馬上熟睡。一覺到天亮，決不把疲勞和壓力留到第二天。醫生都說我很正常。','#14336b','1//0eMlgTEETtuccCgYIARAAGA4SNwF-L9IrFCfcsNjWcm01GXu3mM0eWmxtLBdR1gjCE5M7X6Mp4HyNCUQBlcEyE5aJuqIVwnNow4g','2021-07-07 16:49:18','2021-07-07 16:49:18',NULL),
