	(12,2,12,'service','整復管理','精、氣、神，\r\n脈、筋、骨，\r\n穴、絡、點。\r\n利用漢方的導引術、按蹺術。\r\n導氣引體─提升自身免疫力、排濕、排酸、排穢氣。\r\n按蹺形正─養血排瘀、經脈疏通、消組織液、復位校正。\r\n【均使用純漢方養生產品】','03f00ad22022fc27f7a9fcfbcaedcbc07bcba65c.jpg',3,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
