	(57,39,57,'service','皮膚管理','台灣DRG絕麗20年專業醫美護膚品牌\r\n\r\n10項全能問題皮膚8合1雞尾酒療法！\r\n解決皮膚10大問題\r\n✅粉刺✅痘痘✅囊腫✅結節✅敏感\r\n✅痘印✅斑點✅黃氣✅毛孔✅凹洞\r\n\r\n頂級專業個人細緻化服務','ad993af3773faf2a2689ad4e6cdc5c4c55a0bf29.jpg',12,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(58,39,58,'service','生活美容','做臉就是定期保養皮膚，維持皮膚機能的方式之一，定期做臉且挑對店家選對適合自己的課程，真的是可以維持皮膚機能的，當然這跟保養車子一樣道理，皮膚總有一天還是會老，做臉只是延遲它老的速度，拉長它美麗的時限。','6d8ffe90bf5d1a793626fe619abd49b72105fac6.jpg',2,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
	(59,39,59,'service','光影紋繡','108-110年色麻·薄結痂·微創入色，舒適·結合素描明暗光彩和平化妝技術，讓品質更細膩的紋繡成品，入色率高達90%。\r\n光影紋繡源自於義大利，相較於老式傳統紋繡，不腫、不痛、不流血是其特色！介於微整美容術與化妝術之間的美容技術，讓全臉眉型、眼型、唇型自然呈現化妝效果，並維持二到三年更長時間，韓國又稱「半永久化妝術」，日本稱「美容化妝」，義大利稱「光影紋繡」','c983e37933f2b0ca0ff929110468553e6f4831d3.jpg',4,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL),
