	(64,39,64,'service','美體芳療','按摩可幫助肌肉放鬆，增加血管彈性、加強血液循環，使身體代謝能力提升～藉由經絡及肌肉的按壓、油推，放鬆緊繃的肌肉，使張力恢復平衡，達到放鬆身心、消除疲勞的作用。','e4b011f7434fd77895551f856e003bbe949089a3.jpg',8,'2021-07-07 16:49:14','2021-07-07 16:49:14',NULL),
