	(12,1,3,12,'service','隨心所欲の染','塗鴉指在公共、私有設施或牆壁上的人為和有意圖的標記。塗鴉可以是圖畫，也可以是文字。未經設施擁有者許可的塗鴉一般屬違法或犯罪行為。\r\n「塗鴉」一詞除了作為\"Graffiti\"的中譯外，中國書法的題字，也有在下款署以「某某塗鴉」代替「某某題」的做法，以示謙卑（習慣上，書法到了一定水準的才能署以「某某題」）。\r\n塗鴉早於一些文明古國如古希臘和羅馬帝國便有存在。如果把塗鴉定義得再廣一些，史前時期的人們在洞穴中塗上的壁畫也可算是塗鴉。\r\n\r\n時至今日，「塗鴉」在一定程度上為這種街頭藝術賦予一定認受性。不然，這些作品的稱呼將會是「亂畫」「畫狗屎」或「塗污」。','1b14e88db0c14df16a4a6b346cc3d3665cb8124a.jpg',55,1,3,'55',1,15,NULL,NULL,'published',1,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL,'IkFCwyEdg0nw1DXDHsX7'),
