	(214,39,61,214,'service','其他除毛服務','「除毛方式百百種，為什麼一定要選擇熱蠟除毛？也可以在家自己除阿！」這一定是很多女孩心裡的疑問，但是自己在家除毛時，是不是發現用除毛刀自己除，總是會留下黑黑的毛頭在肌膚裡，腋下殘留黑黑的毛頭一大片反而更醜了。而刮毛膏有濃濃的化學味伴隨著一些可能除毛不成還使肌膚變得紅紅的，這時候你需要「熱蠟除毛」拯救你的毛毛危機！','eb3b735130bff4e1fbd244cd5ded8c73189df90a.jpg',9999,1,4,'依施作情況計價',1,60,NULL,NULL,'published',7,'2021-07-07 16:49:13','2021-07-07 16:49:13',NULL,'SSACMF4E125068609370'),
